/*Table structure for table `InviteBall` */

DROP TABLE IF EXISTS `InviteBall`;

CREATE TABLE `InviteBall` (
  `ID` char(32) NOT NULL COMMENT '约球',
  `Invite_ball_no` int(11) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT '约球编号',
  `Create_time` datetime NOT NULL COMMENT '创建时间',
  `Modify_time` datetime DEFAULT NULL COMMENT '修改时间',
  `End_time` datetime NOT NULL COMMENT '报名截止时间',
  `Active_time` datetime NOT NULL COMMENT '活动时间',
  `Title` varchar(50) NOT NULL COMMENT '标题',
  `Venue_name` varchar(30) DEFAULT NULL COMMENT '场地名称',
  `Venue_address` varchar(100) DEFAULT NULL COMMENT '场地详细地址',
  `Longitude` double NOT NULL COMMENT '经度',
  `Latitude` double NOT NULL COMMENT '纬度',
  `Max_boy` int(11) NOT NULL DEFAULT '999' COMMENT '最大人数',
  `Min_boy` int(11) NOT NULL DEFAULT '0' COMMENT '最小人数',
  `To_require` int(1) NOT NULL DEFAULT '1' COMMENT '成团要求(1=不设置，人再少也不取消.2=人不够活动自动取消)',
  `Receive_flag` int(1) NOT NULL DEFAULT '0' COMMENT '是否预收费用(0=否1=是)',
  `Receive_amount_girl` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '预收金额女',
  `Receive_amount_boy` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '预收金额男',
  `Receive_type` int(1) DEFAULT NULL COMMENT '预收类型(1=固定收费2=AA收费)',
  `Exit_flag` int(1) DEFAULT NULL COMMENT '是否允许退出(0=否1=是)',
  `Exit_type` int(1) NOT NULL DEFAULT '2' COMMENT '退出类型(1=直接退出2=需发起人同意)',
  `Exit_fee` int(11) NOT NULL DEFAULT '0' COMMENT '活动前两小时内退出手续费率',
  `Exit_day_fee` int(11) NOT NULL DEFAULT '0' COMMENT '活动时间后当天退出手续费率',
  `Nearby_flag` int(1) NOT NULL DEFAULT '0' COMMENT '是否允许被附近的人看见(0=否1=是)',
  `Name_flag` int(1) NOT NULL DEFAULT '0' COMMENT '姓名是否必填(0=否1=是)',
  `Phone_flag` int(1) NOT NULL DEFAULT '0' COMMENT '手机号是否必填(0=否1=是)',
  `WeChat_flag` int(1) NOT NULL DEFAULT '0' COMMENT '微信号是否必填(0=否1=是)',
  `Content` varchar(200) DEFAULT NULL COMMENT '详情内容',
  `Member_id` varchar(32) NOT NULL COMMENT '发起人',
  `Ball_type` int(1) NOT NULL DEFAULT '0' COMMENT '约球状态(0=发起中1=到期截止2=提前截止3=取消活动)',
  `Count_flag` int(1) NOT NULL DEFAULT '0' COMMENT '是否已结算收费金额',
  `Arrive_time` datetime DEFAULT NULL COMMENT '到账时间',
  `Arrive_amount` double(11,2) DEFAULT NULL COMMENT '到账金额',
  `AAFlag` int(1) NOT NULL DEFAULT '0' COMMENT '是否已经发起过AA退款(0=否1=是)',
  PRIMARY KEY (`ID`),
  KEY `Invite_ball_no` (`Invite_ball_no`)
) ENGINE=MyISAM AUTO_INCREMENT=10000000 DEFAULT CHARSET=utf8 COMMENT='约球表';

