/*Table structure for table `InviteJoin` */

DROP TABLE IF EXISTS `InviteJoin`;

CREATE TABLE `InviteJoin` (
  `ID` varchar(32) NOT NULL COMMENT 'ID-加入约球',
  `Invite_join_no` int(11) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT '加入约球编号',
  `Create_time` datetime NOT NULL COMMENT '创建时间',
  `Invite_id` varchar(32) NOT NULL COMMENT '约球ID',
  `Member_id` varchar(32) NOT NULL COMMENT '会员ID',
  `Amount` double(11,2) DEFAULT NULL COMMENT '支付金额',
  `GirlFlag` int(1) NOT NULL DEFAULT '0' COMMENT '是否是女生(0=否1=是)',
  `Name` varchar(20) DEFAULT NULL COMMENT '姓名',
  `WeChat_id` varchar(50) DEFAULT NULL COMMENT '微信号',
  `Phone` varchar(11) DEFAULT NULL COMMENT '手机号码',
  `Content` varchar(100) DEFAULT NULL COMMENT '报名备注',
  `Pay_time` datetime DEFAULT NULL COMMENT '支付时间',
  `Pay_type` int(1) NOT NULL DEFAULT '0' COMMENT '支付状态(0=待支付1=支付成功2=已取消3=已退款4=无需支付)',
  `Refund_flag` int(1) NOT NULL DEFAULT '0' COMMENT '退出状态(0=未退出1=退出退费2=退出申请)',
  `Refund_content` varchar(100) DEFAULT NULL COMMENT '退费理由',
  `Refund_amount` double(11,2) DEFAULT NULL COMMENT '退费金额',
  `Refund_feeAmount` double(11,2) DEFAULT NULL COMMENT '退费手续费金额',
  `Refund_fee` int(11) DEFAULT NULL COMMENT '退费手续费率',
  `ShareSum` int(11) NOT NULL DEFAULT '0' COMMENT '分享总次数',
  PRIMARY KEY (`ID`),
  KEY `Invite_join_no` (`Invite_join_no`)
