/*Table structure for table `InviteLog` */

DROP TABLE IF EXISTS `InviteLog`;

CREATE TABLE `InviteLog` (
  `ID` varchar(32) NOT NULL COMMENT 'ID-约球日志',
  `Create_time` datetime NOT NULL COMMENT '创建时间',
  `Member_id` varchar(32) DEFAULT NULL COMMENT '用户ID',
  `InviteBall_id` varchar(32) DEFAULT NULL COMMENT '约球ID',
  `Content` varchar(100) DEFAULT NULL COMMENT '内容',
  `Type` int(1) NOT NULL DEFAULT '0' COMMENT '类型(0=留言1=通知)',
  PRIMARY KEY (`ID`)
