/*Table structure for table `Member` */

DROP TABLE IF EXISTS `Member`;

CREATE TABLE `Member` (
  `ID` char(32) NOT NULL COMMENT '会员',
  `MemberNo` int(11) NOT NULL AUTO_INCREMENT COMMENT '会员编号',
  `CreateTime` datetime NOT NULL COMMENT '创建时间',
  `ModifyTime` datetime NOT NULL COMMENT '修改时间',
  `Name` varchar(10) DEFAULT NULL COMMENT '姓名',
  `Phone` varchar(11) DEFAULT NULL COMMENT '手机号',
  `Password` varchar(100) DEFAULT NULL COMMENT '密码',
  `ManagerID` varchar(32) DEFAULT NULL COMMENT '管理员ID',
  `OpenID` varchar(50) DEFAULT NULL COMMENT '微信公众号的openid',
  `AppOpenID` varchar(50) DEFAULT NULL COMMENT '小程序的openid',
  `AppIosOpenID` varchar(50) DEFAULT NULL COMMENT 'APP客户端的openid',
  `UnionID` varchar(50) DEFAULT NULL COMMENT '公众平台下的唯一标识',
  `AppNickName` varchar(50) DEFAULT NULL COMMENT '微信昵称',
  `AppAvatarUrl` varchar(300) DEFAULT NULL COMMENT '头像URL',
  `AppGender` int(1) DEFAULT NULL COMMENT '微信性别(0=未知1=女2=男)',
  `WechatID` varchar(50) DEFAULT NULL COMMENT '微信号',
  `WXPayment` double(11,2) NOT NULL DEFAULT '1000.00' COMMENT '微信转账免手续费额度',
  `ShowPhone` int(1) NOT NULL DEFAULT '0' COMMENT '是否显示手机号',
  `ShowHistory` int(1) NOT NULL DEFAULT '0' COMMENT '是否显示历史活动',
  `ShowWechatID` int(1) NOT NULL DEFAULT '0' COMMENT '是否显示微信号',
  PRIMARY KEY (`ID`),
  KEY `MemberNo` (`MemberNo`)
) ENGINE=MyISAM AUTO_INCREMENT=10000009 DEFAULT CHARSET=utf8 COMMENT='会员表';

