/*Table structure for table `Period` */

DROP TABLE IF EXISTS `Period`;

CREATE TABLE `Period` (
  `ID` char(32) NOT NULL COMMENT '时段',
  `VenueID` varchar(32) NOT NULL COMMENT '场馆ID',
  `FieldID` varchar(32) NOT NULL COMMENT '场地ID',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `Period` */

/*Table structure for table `Reserve` */

DROP TABLE IF EXISTS `Reserve`;

CREATE TABLE `Reserve` (
  `ID` char(32) NOT NULL COMMENT '预定(订场)',
  `CreateTime` datetime NOT NULL COMMENT '创建时间',
  `FieldID` varchar(32) NOT NULL COMMENT '场地ID',
  `ReserveTimeFrame` varchar(20) NOT NULL COMMENT '预约时段',
  `ReserveAmount` double(10,2) NOT NULL COMMENT '预约金额',
  `OrderID` varchar(32) NOT NULL COMMENT '所属订单ID',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

