/*Table structure for table `Staff` */

DROP TABLE IF EXISTS `Staff`;

CREATE TABLE `Staff` (
  `ID` varchar(32) NOT NULL COMMENT '伙伴->伙伴',
  `Staff_no` int(8) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT '伙伴编号',
  `Name` varchar(10) DEFAULT NULL COMMENT '姓名',
  `DeptID` char(32) DEFAULT NULL COMMENT '部门ID(暂未启用)',
  `Password` char(32) DEFAULT NULL COMMENT '登录密码',
  `Tel` char(11) DEFAULT NULL COMMENT '电话',
  `Status_flag` enum('正常','冻结','异常') NOT NULL DEFAULT '正常' COMMENT '状态',
  `Position` enum('经理','职员','临时') NOT NULL DEFAULT '临时' COMMENT '岗位',
  `Power` int(2) NOT NULL DEFAULT '7' COMMENT '平台权限(最高级七级)',
  `Sex` enum('男','女','不详') NOT NULL DEFAULT '男' COMMENT '性别',
  `IDCard` varchar(20) DEFAULT NULL COMMENT '身份证号',
  `Address` varchar(50) DEFAULT NULL COMMENT '家庭住址',
  `Referee` varchar(10) DEFAULT NULL COMMENT '推荐人',
  `Nickname` varchar(100) DEFAULT NULL COMMENT '微信昵称',
  `Head_image` varchar(200) DEFAULT NULL COMMENT '用户头像URL',
  `Login_change` datetime DEFAULT NULL COMMENT '登录切换时间',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  `Openid` varchar(100) DEFAULT NULL COMMENT '微信登录返回的OpenID',
  `Unionid` varchar(100) DEFAULT NULL COMMENT '当且仅当该网站应用已获得该用户的userinfo授权时，才会出现该字段。',
  PRIMARY KEY (`ID`),
  UNIQUE KEY `StaffNo` (`Staff_no`),
  UNIQUE KEY `Opendid_one` (`Openid`)
) ENGINE=InnoDB AUTO_INCREMENT=75596164 DEFAULT CHARSET=utf8 COMMENT='伙伴表';

