/*Table structure for table `StaffApply` */

DROP TABLE IF EXISTS `StaffApply`;

CREATE TABLE `StaffApply` (
  `ID` varchar(32) NOT NULL COMMENT '伙伴申请表',
  `Staff_no` int(8) unsigned zerofill NOT NULL AUTO_INCREMENT COMMENT '伙伴编号',
  `Name` varchar(10) DEFAULT NULL COMMENT '姓名',
  `Tel` char(11) DEFAULT NULL COMMENT '电话',
  `Sex` enum('男','女','不详') NOT NULL DEFAULT '男' COMMENT '性别',
  `Referee` varchar(10) DEFAULT NULL COMMENT '推荐人',
  `Nickname` varchar(100) DEFAULT NULL COMMENT '微信昵称',
  `Head_image` varchar(200) DEFAULT NULL COMMENT '用户头像URL',
  `Apply_time` datetime DEFAULT NULL COMMENT '申请时间',
  `Remark` varchar(20) DEFAULT NULL COMMENT '备注',
  `Openid` varchar(100) DEFAULT NULL COMMENT '微信登录返回的OpenID',
  `Unionid` varchar(100) DEFAULT NULL COMMENT '当且仅当该网站应用已获得该用户的userinfo授权时，才会出现该字段。',
  `Check_staff` varchar(32) DEFAULT NULL COMMENT '审核人',
