/*Table structure for table `TrainCoach` */

DROP TABLE IF EXISTS `TrainCoach`;

CREATE TABLE `TrainCoach` (
  `ID` varchar(32) NOT NULL COMMENT 'ID',
  `Create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `Modify_time` datetime DEFAULT NULL COMMENT '修改时间',
  `Train_team_id` varchar(32) DEFAULT NULL COMMENT '培训机构',
  `Member_id` varchar(32) DEFAULT NULL COMMENT '用户ID',
  `Name` varchar(10) NOT NULL COMMENT '姓名',
  `Type` int(1) NOT NULL DEFAULT '1' COMMENT '1=主教2助教',
  `Sex` int(1) NOT NULL DEFAULT '0' COMMENT '性别0=未知1=男2=女',
  `Working_age` int(11) NOT NULL DEFAULT '0' COMMENT '教学年龄',
  `Head_image` varchar(300) DEFAULT NULL COMMENT '头像',
  `Lecture_style` varchar(200) DEFAULT NULL COMMENT '讲课风格',
  `Vitae` varchar(200) DEFAULT NULL COMMENT '个人简介',
  `Education` varchar(100) DEFAULT NULL COMMENT '教育背景',
  `Honor` varchar(100) DEFAULT NULL COMMENT '相关经历',
  `Teach_class` varchar(50) DEFAULT NULL COMMENT '青少年初级班、青少年中级班、青少年提高班、成人初级班、成人中级班、成人提高班、1对1辅导班、其他)',
  `Phone` varchar(11) NOT NULL COMMENT '手机号',
  `Manager` int(1) NOT NULL DEFAULT '0' COMMENT '权限级别(1=发起人2=管理员)',
  PRIMARY KEY (`ID`),
  UNIQUE KEY `Member_id` (`Member_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='培训机构教练表';

