/*Table structure for table `TrainEnter` */

DROP TABLE IF EXISTS `TrainEnter`;

CREATE TABLE `TrainEnter` (
  `ID` varchar(32) NOT NULL COMMENT 'ID',
  `Create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `Member_id` varchar(32) DEFAULT NULL COMMENT '申请人',
  `Title` varchar(100) DEFAULT NULL COMMENT '机构名称',
  `Longitude` double DEFAULT NULL COMMENT '经度',
  `Latitude` double DEFAULT NULL COMMENT '纬度',
