  `Head_image` varchar(200) DEFAULT NULL COMMENT '封面图',
  `City_name` varchar(100) DEFAULT NULL COMMENT '城市名',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='培训机构入驻申请表';

