/*Table structure for table `VenueCheck` */

DROP TABLE IF EXISTS `VenueCheck`;

CREATE TABLE `VenueCheck` (
  `ID` varchar(32) NOT NULL COMMENT 'ID',
  `Create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `Modify_time` datetime DEFAULT NULL COMMENT '修改时间',
  `Title` varchar(200) DEFAULT NULL COMMENT '场馆名',
  `Ball_type` int(1) DEFAULT NULL COMMENT '球场类型(1=网球场2=足球场3=羽毛球馆)',
  `Phone` varchar(20) DEFAULT NULL COMMENT '电话号码',
  `Head_image` varchar(1000) DEFAULT NULL COMMENT '封面图',
  `Content` varchar(200) DEFAULT NULL COMMENT '描述',
  `Lng` double DEFAULT NULL COMMENT '经度',
  `Lat` double DEFAULT NULL COMMENT '纬度',
  `Address` varchar(200) DEFAULT NULL COMMENT '地址',
  `Train_team_id` varchar(32) DEFAULT NULL COMMENT '培训机构ID',
  `Check_flag` int(1) DEFAULT NULL COMMENT '审核状态(0=审核中1=审核通过2=审核不通过)',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='场馆审核表';

