/*Table structure for table `VenueEnter` */

DROP TABLE IF EXISTS `VenueEnter`;

CREATE TABLE `VenueEnter` (
  `ID` varchar(32) NOT NULL COMMENT 'ID',
  `Create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `Member_id` varchar(32) DEFAULT NULL COMMENT '申请人',
  `Title` varchar(100) DEFAULT NULL COMMENT '球场名称',
  `Longitude` double DEFAULT NULL COMMENT '经度',
  `Latitude` double DEFAULT NULL COMMENT '纬度',
  `Address` varchar(100) DEFAULT NULL COMMENT '地址',
  `Check_flag` int(1) NOT NULL DEFAULT '0' COMMENT '审核状态0=待审核1=审核通过2=审核拒绝',
  `Ball_type` int(1) DEFAULT NULL COMMENT '球场类型(1=网球场2=足球场3=羽毛球馆4=篮球场)',
