  `Check_staff` varchar(32) DEFAULT NULL COMMENT '审核人',
  `Main_name` varchar(100) DEFAULT NULL COMMENT '负责人',
  `Main_phone` varchar(100) DEFAULT NULL COMMENT '负责人电话',
  `Ball_sum` varchar(100) DEFAULT NULL COMMENT '球场片数',
  `Content` varchar(100) DEFAULT NULL COMMENT '审核意见',
  `Head_image` varchar(1000) DEFAULT NULL COMMENT '封面图',
  `City_name` varchar(100) DEFAULT NULL COMMENT '城市名',
  `Train_team_name` varchar(100) DEFAULT NULL COMMENT '机构名称',
  `City_id` varchar(32) DEFAULT NULL COMMENT '城市ID',
  `District_id` varchar(32) DEFAULT NULL COMMENT '区县ID',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

