/*Table structure for table `WXBill` */

DROP TABLE IF EXISTS `WXBill`;

CREATE TABLE `WXBill` (
  `ID` varchar(32) NOT NULL COMMENT '微信支付',
  `CreateTime` datetime NOT NULL COMMENT '创建时间',
  `DealTime` datetime DEFAULT NULL COMMENT '交易时间',
  `WX_appid` varchar(50) DEFAULT NULL COMMENT '公众账号ID',
  `WX_mchid` varchar(50) DEFAULT NULL COMMENT '商户号',
  `Son_mchid` varchar(50) DEFAULT NULL COMMENT '子商户号',
  `Device_info` varchar(50) DEFAULT NULL COMMENT '设备号',
  `WX_orderid` varchar(50) DEFAULT NULL COMMENT '微信订单号',
  `Store_orderid` varchar(50) DEFAULT NULL COMMENT '商户订单号',
  `Openid` varchar(50) DEFAULT NULL COMMENT '用户标识',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='微信对账表';

/*Data for the table `WXBill` */

/*Table structure for table `WXCompanyPayment` */

DROP TABLE IF EXISTS `WXCompanyPayment`;

CREATE TABLE `WXCompanyPayment` (
  `ID` char(32) NOT NULL COMMENT 'ID',
  `Create_time` datetime NOT NULL COMMENT '创建时间',
  `Order_id` varchar(32) NOT NULL COMMENT '商户订单号',
  `Openid` varchar(50) NOT NULL COMMENT 'openid',
  `User_name` varchar(10) DEFAULT NULL COMMENT '用户姓名',
  `amount` double(11,2) NOT NULL COMMENT '付款金额',
  `Desc` varchar(100) NOT NULL COMMENT '付款描述',
  `Pay_type` int(1) NOT NULL COMMENT '支付状态(1=支付成功2=支付失败)',
  `Pay_msg` varchar(200) DEFAULT NULL COMMENT '支付信息',
  `Return_xml` varchar(2000) NOT NULL COMMENT '微信返回参数',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='微信企业支付流水';

